import React, { useEffect } from 'react'
import axios from 'axios'

const TrendingMovies = () => {
  const geTrendingMovies = () => {
    // setPopularMovies(true)
    axios.get('https://api.themoviedb.org/3/trending/all/day?api_key=c1531b875c30a4f389deb26c9dc8e1f4')
      .then((res) => {
        // console.log(res)
        const { data: { results } } = res
        // console.log(results, 'results')
        // update array
        setPopularData(results)
      })
      .catch((err) => {
        console.log(err)
      })
  }

  useEffect(() => {
    geTrendingMovies()
  }, [])
  return (
    <>
      Trending
    </>
  )
}

export default TrendingMovies
